import React from 'react';

export const Header = () => {
  const ul = {
        textAlign:"center",
        listStyleType: "none",
        margin: 0,
        padding: 0,
        overflow: "hidden",
        backgroundColor: "#333",
        marginBottom:"20px"
      }
      
      const li = {
        float: "left"
      }
      
     
        return (
            <ul style={ul}>
                <li style={li}>Files</li>
                <li>new File</li>
            </ul>
        )
}
